import React from "react";
import styles from "./styles.module.css"
import logo from "../../_assets/logo.png"

const Header=(props)=>{
    return (
        <div className="col-12">
            <div className="col-2">
            <img src={logo} alt="" />
            </div>
            <div className="col-10">

            </div>
        </div>
    )
}
export default Header
